import React, { Component } from "react";
import { Link } from "react-router-dom";

class Login extends Component {
  state = {
    username: ""
  };

  validateForm() {
    return this.state.email.length > 0 && this.state.password.length > 0;
  }
  render() {
    return <>Hello</>;
  }
}

export default Login;
